// import { useEffect } from "react";

const ClientForm = ({fields} : any) => {

    const inputs = fields.map((e : any) => (
        <div>
            <p>{e.fieldName}</p>
            <input defaultValue={e.fieldType} />
        </div>
    ))

    return (
        <div>
            {inputs}
        </div>
    )
}

export default ClientForm;
